    true,nt"url": null,nt"notes": "IDEA Part C Section 618 Table 3 Exiting,
    2011-2012 (IDEA Part C Table 3 2011-2012), is a study that is part of the IDEA Part
    C program; program data is available since 2006 at <http://tadnet.public.tadnet.org/pages/712>.
    IDEA Part C Table 3 2011-2012 is a cross-sectional universe report that collected
    counts of infants and toddlers with disabilities in each state who (a) are served
    under IDEA Part C, (b) are served in different program settings, and (c) exit Part
    C because of program completion or for other reasons. States submitted the report
    in spreadsheet form by mail or electronically by e-mail. Key statistics produced
    from IDEA Part C Table 3 2011-2012 provide insights on the demographics of children
    served under IDEA Part C, service settings, referral to preschool or other services,
    and personnel providing early intervention services.",nt"license_title": "Creative
